import React from "react";
import { useState, useEffect } from "react";
import Leaguetable from "../components/Leaguetable";

const Lastmatcheng = () => {
  const [data, setData] = useState([]);
  const vals = Object.values(data);
  useEffect(() => {
    const options = {
      method: "GET",
      headers: {
        "X-RapidAPI-Key": "b529891cd2mshe7bca90aba3fe87p1dabf4jsnaea3d94ce638",
        "X-RapidAPI-Host": "football98.p.rapidapi.com",
      },
    };
    fetch("https://football98.p.rapidapi.com/premierleague/table", options)
      .then((response) => response.json())
      .then((data) => {
        setData(data);
      })
      .catch((err) => console.error(err));
  }, []);
  console.log(vals);

  return (
    <div className="text-white shadow-xl absolute top-[150px] right-10 w-[400px] h-[774px] bg-white">
      <div className="w-full h-[15%] flex justify-center ">
        <h1 className="text-black text-2xl mt-4">Premier League 2022/2023</h1>
      </div>
      <div className="flex  w-full h-[60px] justify-between text-black">
        <h1>Position</h1>
        <h1>Name</h1>
        <h1>Played</h1>
        <h1>Lost</h1>

        <h1>Won</h1>
        <h1>Draw</h1>
        <h1>Points</h1>
      </div>
      <div className="h-full w-full bg-black flex-col justify-center">
        {vals.map((item) => {
          return (
            <div className="flex  w-[80%] bg-yellow h-[30px] justify-between text-black">
              <h1>{item.Position}</h1>
              <h1>{item.Name}</h1>
              <h1>{item.Played}</h1>
              <h1>{item.Loosed}</h1>
              <h1>{item.Winned}</h1>
              <h1>{item.Tie}</h1>
              <h1>{item.Points}</h1>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Lastmatcheng;
